import {useQuery, gql} from '@apollo/client';
const GET_MY_NOTES= gql`
query me{
    me{
        id
        username
        notes{
            notes{
                id
                createdAt
                content
                favoriteCount
                author{
                    username
                    id
                    avatar
                }
            }
        }
    }
}
`;

const GET_NOTE= gql`
    query note($id: ID!){
        note(id: $id){
            id
            createdAt
            content
            favoriteCount
            author{
                username
                id
                avatar
            }
        }
    }

`;
const NEW_NOTE= gql`
mutation newNote($content: String!){
    newNote(content: $content){
        id
        content
        createdAt
        favoriteCount
        favoritedBy{
            id
            username            
        }author{
            username
            id
        }
    }
}
`;

const GET_NOTES=gql`
query noteFeed($cursor: String){
    noteFeed(cursor:  $cursor){
        cursor
        hasNextPage
        notes{
            id
            createdAt
            content
            favoriteCount
            author{
                username
                id
                avatar            
            }
        }
    }
}
`;

const IS_LOGGED_IN= gql`
{
    isLoggedIn @client
}
`;

export {GET_NOTES, GET_NOTE, IS_LOGGED_IN, GET_MY_NOTES}
